// C:\Users\Administrator\OneDrive\Documente\GitHub\salarizare\modern-backend\frontend\src\components\dashboard\Dashboard.js
import React, { useState, useEffect } from 'react'
import { Card, CardContent, CardHeader, CardTitle } from '../ui/card'
import { Activity, Users, Truck, Calendar } from 'lucide-react'
import { dashboardApi } from '../../services/api/dashboard'
import { RecentActivity } from './RecentActivity'
import { ExpiringDocuments } from './ExpiringDocuments'
import { DriverStatus } from './DriverStatus'

export default function Dashboard() {
 const [stats, setStats] = useState({
   totalDrivers: 0,
   activeDrivers: 0,
   driversOnHoliday: 0,
   totalVehicles: 0
 })
 const [loading, setLoading] = useState(true)

 useEffect(() => {
   loadDashboardData()
 }, [])

 const loadDashboardData = async () => {
   try {
     const response = await dashboardApi.getStats()
     setStats(response.data)
   } catch (error) {
     console.error('Error loading dashboard data:', error)
   } finally {
     setLoading(false)
   }
 }

 if (loading) {
   return (
     <div className="flex items-center justify-center h-full">
       <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-primary"></div>
     </div>
   )
 }

 return (
   <div className="flex-1 space-y-4 p-8 pt-6">
     <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-4">
       <StatsCard
         title="Total Șoferi"
         value={stats.totalDrivers}
         icon={<Users className="h-4 w-4 text-muted-foreground" />}
         trend={stats.driversTrend}
       />
       <StatsCard
         title="Șoferi Activi"
         value={stats.activeDrivers}
         icon={<Activity className="h-4 w-4 text-muted-foreground" />}
         trend={stats.activeDriversTrend}
       />
       <StatsCard
         title="În Concediu"
         value={stats.driversOnHoliday}
         icon={<Calendar className="h-4 w-4 text-muted-foreground" />}
         trend={stats.holidayDriversTrend}
       />
       <StatsCard
         title="Total Vehicule"
         value={stats.totalVehicles}
         icon={<Truck className="h-4 w-4 text-muted-foreground" />}
         trend={stats.vehiclesTrend}
       />
     </div>

     <div className="grid gap-4 md:grid-cols-2 lg:grid-cols-7">
       <Card className="col-span-4">
         <CardHeader>
           <CardTitle>Activitate Recentă</CardTitle>
         </CardHeader>
         <CardContent>
           <RecentActivity />
         </CardContent>
       </Card>
       <Card className="col-span-3">
         <CardHeader>
           <CardTitle>Documente care Expiră</CardTitle>
         </CardHeader>
         <CardContent>
           <ExpiringDocuments />
         </CardContent>
       </Card>
     </div>

     <DriverStatus />
   </div>
 )
}

const StatsCard = ({ title, value, icon, trend }) => {
 return (
   <Card>
     <CardHeader className="flex flex-row items-center justify-between space-y-0 pb-2">
       <CardTitle className="text-sm font-medium">{title}</CardTitle>
       {icon}
     </CardHeader>
     <CardContent>
       <div className="text-2xl font-bold">{value}</div>
       {trend && (
         <p className={`text-xs ${
           trend > 0 ? 'text-green-600' : 
           trend < 0 ? 'text-red-600' : 
           'text-muted-foreground'
         }`}>
           {trend > 0 ? '+' : ''}{trend} față de luna trecută
         </p>
       )}
     </CardContent>
   </Card>
 )
}
